import "./styles/FooterListItem.css";
import dataFooter from "./../../../data/footer.json";
import FooterItem from "./FooterItem";
import { styled } from "styled-components";

const StyledFooterList = styled.div``;

export default function FooterListItem() {
  return (
    <StyledFooterList className="container-footer">
      {dataFooter.map((item) => (
        <FooterItem col_values={item.col_values} />
      ))}
    </StyledFooterList>
  );
}
